🫧Unpack our new bath kneeler from @fivestarbabystore 🫧

This has an extra thick and wide pad for comfort on your elbows and knees for when you’re bathing your little one! It’s safe, non-slip and has a convenient Velcro hanging strap to air dry when not in use. 
My favorite part is the 4 extra large pockets on BOTH sides of the tub for extra storage of all your bath time essentials!

