@coterie is a game changer!! Choosing The Diaper was a no brainer for us after learning that they’re made with the cleanest materials (no yucky irritants). Choosing to STAY with Coterie was due to how truly absorbent and soft they are (up to 70% more absorbent than leading diaper brands and literally feels like cashmere!!). We love the fact that it doubles as a night diaper… so no worrying about purchasing a separate diaper for nighttime.

Comment “diaper” to get the direct link, and use code WILSON20 to save! 

